import logo from './logo.svg';
import './App.css';
import Index from './pages/index/Index';

const App = () => {


    let route = (
      <Switch>
        <Route path="/index" component={Index} />

        <Redirect to='/index' />
      </Switch>
    )
    return (
      <div>
        {route}
      </div>
  );
}

export default App;
